import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable, Observer, catchError, concatMap, from, of } from 'rxjs';
import { FileContentType } from 'src/app/enums/file-content-type.enum';
import { Base64 } from 'src/app/shared/interfaces/base64.interface';
import { AlertService } from 'src/app/shared/services/alert.service';
import { UploadedFile } from 'src/app/shared/interfaces/upload-file.interface';

@Injectable({ providedIn: 'root' })
export class FileUploadService {
    uploadedFilesSubject$: BehaviorSubject<UploadedFile[]> = new BehaviorSubject<UploadedFile[]>([]);
    uploadedFiles: UploadedFile[] = [];
    private maxFileMBSize: number = 2;
    private maxFileKbSize: number = 2048;
    constructor(private alertService: AlertService) { }

    uploadFiles(files: FileList): Observable<any> {
        return from(files)
            .pipe(
                concatMap((file: File) => this.validateFile(file).pipe(
                    catchError((error: UploadedFile) => of(error))
                ))
            );
    };

    validateFile(file: File): Observable<UploadedFile> {
        const fileReader = new FileReader();
        const { type, name } = file;
        return new Observable((observer: Observer<UploadedFile>) => {
            if (this.validateSize(file, observer)) {
                fileReader.readAsDataURL(file);
                fileReader.onload = (_event: any) => {
                    if (this.isImage(type, observer)) {
                        observer.next({ file, url: fileReader.result as string });
                        observer.complete();
                    }
                }
            };
            fileReader.onerror = () => {
                observer.error({ error: { name, errorMessage: 'invalid file' } });
            };
        });
    }

    validateSize(file: File, observer: Observer<UploadedFile>): boolean {
        const { name, size } = file;

        if (!this.isValidSize(size)) {
            observer.error({ error: { name, errorMessage: 'is too big. maxiumum size: 2MB' } });
            return false;
        }
        return true;
    }

    isImage(mimeType: string, observer: Observer<UploadedFile>): boolean {
        if (!mimeType.match(/image\/*/)) {
            observer.error({ error: { name, errorMessage: 'must be in .JPG, .JPEG or .PNG format' } });
            return false;
        }
        return true;
    }

    private isValidSize(size: number): boolean {
        const toKByte = size / 1024;
        return toKByte >= this.maxFileMBSize && toKByte <= this.maxFileKbSize;
    }

    convertFileToBase64(file: File): Promise<Base64> {
        const reader = new FileReader();
        return new Promise<Base64>((resolve, reject) => {
            try {
                reader.readAsDataURL(file);
                return reader.onload = () => {
                    const splitBase64Info: string[] = (reader.result as string).split(',');
                    const base64: string = splitBase64Info[1];
                    const contentType = splitBase64Info[0].split(';')[0] as FileContentType;
                    resolve({
                        fileName: File.name,
                        base64,
                        contentType
                    });
                };
            } catch {
                reject(() => {
                    this.alertService.error('co≈õ poszlo nie tak');
                    return;
                });
            }
        });
    }

    convertFilesToBase64List(files: File[]): Promise<Base64[]> {
        const promises: Promise<Base64>[] = [];
        files.forEach((file: File) => {
            promises.push(
                this.convertFileToBase64(file).then((base64: Base64) => {
                    return base64;
                })
            );
        });
        return Promise.all(promises).then((promisesList: Base64[]) => {
            return promisesList;
        });
    }

    AddDefaultFile() {
        this.uploadedFilesSubject$.next([this.defaultFile()]);
    }

    defaultFile(): UploadedFile {
        return {
            url: "data:image/png;base64,"
        }
    }
}
